import React from 'react';
import PropTypes from 'prop-types';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import Icon from 'react-icons-kit';
import {arrows_plus} from 'react-icons-kit/linea/arrows_plus';
import Grid from '@material-ui/core/Grid';

function TabContainer(props) {
  return (
    <Typography component="div">
      {props.children}
    </Typography>
  );
}

TabContainer.propTypes = {
  children: PropTypes.node.isRequired,
};

class SimpleTabs extends React.Component {
  constructor(props){
    super(props);
    this.state = {
    value: 0,
  };}

  handleChange  (event, value)  {
    this.setState({ value });
  };

  render() {
    const { value } = this.state;

    return (
      <div className="RightPaneRoot">
        <div className="Header">
          <div className="Top">
            <Typography id="overline">USER</Typography>
            <Button variant="raised" color="primary" size="small" className="FollowButton" disabled><Icon icon={arrows_plus} size={20} className="PlusIcon"/>Follow</Button>
          </div>
          <Typography variant = "display3">
            {this.props.props.match.params.user}
          </Typography>
        </div>
        <Tabs value={value} onChange={this.handleChange} indicatorColor="primary">
          <Tab label="About" />
          <Tab label="Ideas" disabled/>
          <Tab label="Projects" />
        </Tabs>
        {value === 0 && <TabContainer>
          <div className="TabContainer">
            <div className="Bio">
              <Typography variant="body1">bio</Typography>
            </div>
            <div className="UserGrid">
              <Grid container spacing={24}>
                <Grid item xs={12} sm={6}>
                  <div className="TopProjects">
                    <Typography variant="title" className="Title">Top Projects</Typography>
                    <Typography variant="body1" className="Body">coming soon</Typography>
                  </div>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <div className="Activity">
                    <Typography variant="title" className="Title">Activity</Typography>
                    <Typography variant="body1" className="Body">coming soon</Typography>
                  </div>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <div className="RecentDiscussions">
                    <Typography variant="title" className="Title">Recent Discussions</Typography>
                    <Typography variant="body1" className="Body">coming soon</Typography>
                  </div>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <div className="TopContributions">
                    <Typography variant="title" className="Title">Top Contributions</Typography>
                    <Typography variant="body1" className="Body">coming soon</Typography>
                  </div>
                </Grid>
              </Grid>
            </div>
          </div>
        </TabContainer>}
        {value === 1 && <TabContainer>
        </TabContainer>}
        {value === 2 && <TabContainer>
          <div className="TabContainer">
            <div className="Repos">
              <Typography variant="body1" className="Body">coming soon</Typography>
            </div>
          </div>
        </TabContainer>}
      </div>
    );
  }
}


export default SimpleTabs;

